import React from "react";
import "./Header.css"

function SearchBar() { 
  return (
    <React.Fragment>
      <form id = "form">
          <input 
          class = "input is-info"
          type = "text" 
          id = "query" 
          name = "q"
          placeholder="Search your past trips..."/>
          <button class = "button is-info is-outlined is-rounded has-background-info-light">
            Search
          </button>
      </form>
    </React.Fragment>
  )
}

export default SearchBar;
